import { ShopCustomer } from './shop-customer.model';
import { ShopProduct } from './shop-product.model';
export class ShopOrder {
  constructor(partial) {
    Object.assign(this, partial);
  }
  deserialize(input) {
    Object.assign(this, input);
    this.customer = input.customer.map(c => new ShopCustomer({
      ...c
    }).deserialize(c));
    this.product = input.customer.map(p => new ShopProduct({
      ...p
    }).deserialize(p));
    return this;
  }
}
